// File: contracts/SDLC/Bandog_Project/marketplace.sol


pragma solidity ^0.8.0;

contract BandogMarket is Ownable,ERC721Holder {
    IERC20 public USDT;

    mapping(uint256 => bool)public isLocked;

    constructor(address usdtAddress){
        USDT = IERC20(usdtAddress);
    }

    function buyNft(address _nft,uint256 _tokenId)external {
        IERC721A nft = IERC721A(_nft);
        require(msg.sender != owner(),"Not for Owner!");
        require(!isLocked[_tokenId],"This tokenId is locked by Owner");
        require(_tokenId <= nft.totalSupply(),"This tokenId not listed");
        require(nft.ownerOf(_tokenId) == address(this),"This tokenId already sold");
        uint256 price = calculatePrice(_tokenId);
        require(USDT.balanceOf(msg.sender) >= price,"Insufficient funds");
        USDT.transferFrom(msg.sender,address(this),price);
        nft.safeTransferFrom(address(this),msg.sender,_tokenId);

    }

    function transfer(address _nft,uint256 _tokenId,address _mintTo)external onlyOwner {
        IERC721A nft = IERC721A(_nft);
        require(_tokenId <= nft.totalSupply(),"This tokenId not listed");
        require(nft.ownerOf(_tokenId) == address(this),"This tokenId already sold");
        nft.safeTransferFrom(address(this),_mintTo,_tokenId);
    }

    function calculatePrice(uint256 tokenId)public pure returns(uint256){
        if(tokenId > 0 && tokenId <= 100){
            return 105086 * 1e6;
        }
        else if(tokenId > 100 && tokenId <= 600 ){
            return 52543 * 1e6;

        }
        else if(tokenId > 600 && tokenId <= 1000 ){
            return 42035 * 1e6;

        }
        else if(tokenId > 1000 && tokenId <= 2000 ){
            return 31527 * 1e6;

        }
        else if(tokenId > 2000 && tokenId <= 3500 ){
            return 21018 * 1e6;

        }
        else if(tokenId > 3500 && tokenId <= 6000 ){
            return 10510 * 1e6;

        }
        else if(tokenId > 6000 && tokenId <= 7000 ){
            return 5256 * 1e6;

        }
        else if(tokenId > 7000 && tokenId <= 7500 ){
            return 4205 * 1e6;

        }

        else if(tokenId > 7500 && tokenId <= 8000 ){
            return 3154 * 1e6;

        }
        else if(tokenId > 8000 && tokenId <= 8500 ){
            return 2103 * 1e6;

        }
        else if(tokenId > 8500 && tokenId <= 9000 ){
            return 1051 * 1e6;

        }
        else if(tokenId > 9000 && tokenId <= 9200 ){
            return 526 * 1e6;

        }
        else if(tokenId > 9200 && tokenId <= 9400 ){
            return 211 * 1e6;

        }
        else if(tokenId > 9400 && tokenId <= 9600 ){
            return 106 * 1e6;

        }
        else if(tokenId > 9600 && tokenId <= 9800 ){
            return 53 * 1e6;

        }
        else if(tokenId > 9800 && tokenId <= 10000 ){
            return 22 * 1e6;

        }
        else{
            revert("Invalid tokenId");
        }

    }
 
    function lock(uint256 _tokenId) external onlyOwner {
        isLocked[_tokenId] = true;
    }

    function unlock(uint256 _tokenId) external onlyOwner {
        isLocked[_tokenId] = false;
    }

    //retrieve all funds
    function withdraw() external onlyOwner {
        uint256 balance = USDT.balanceOf(address(this));
        require(balance > 0, 'No funds to withdraw, Balance is 0');
        USDT.transfer(msg.sender, balance); 
    }

}
